import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import Grid from '@material-ui/core/Grid';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

const styles = {
  card: {
    maxWidth: 345,
  },
  media: {
    // ⚠️ object-fit is not supported by IE 11.
    objectFit: 'cover',
  },
};

function MealPlanTemplateCard(props) {
  const { classes, image, title, text } = props;
  return (
    <Grid item xs={4}> 
      <Card style={{margin: '0 20px', height: '100%'}}>
        <Grid container style={{height: "100%"}}>
          <Grid item md={5} style={{height: "100%"}}>
            <CardMedia 
              image={image}
              imageTitle={title}
              style={{height: "100%"}}
            />
          </Grid>
          <Grid item md={7} style={{padding: '5px 5px 5px 10px'}}>
            <Typography variant={'subtitle1'}>{text}</Typography>
          </Grid>
        </Grid>
      </Card>
    </Grid>
  );
}

MealPlanTemplateCard.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(MealPlanTemplateCard);
